						slplResource++;
					}
				}
				if ( slplResource <= 20 ) {
					slplStartAnim( 1300, 0, slplMax );
				} else {
					slplStartAnim( Math.min( 20 * slplResource + 900, 5000 ), 0, slplMax );
				}
